import styled from 'styled-components';

const Container = styled.div`
	display: flex;
	justify-content: center;
	align-items: center;
	height: 89vh;
`;

const Heading = styled.h1`
	color: #00aaf4;
	font-size: 153px;
	line-height: 153px;
	margin: 0;
	font-weight: bold;
	font-family: cera_probold, Arial, Helvetica, sans-serif;
`;

const SubHeading = styled.p ``;



const price = (props) => (
	<Container>
			<Heading>JBL Xtreme 2</Heading>
			<p>waterproof portable bluetooth speaker</p>
			<div>
				<img class="jbl-speakers-img" src="assets/images/xtreme2-group.png" alt="Three JBL Xtreme 2 speakers."/>
				<div class="price">
					<p><span class="hyper">$</span>299<span class="hyper">99</span></p>
				</div>
			</div>

	</Container>
)

export default price;
